INSERT INTO `recipes` VALUES (1,'Makisushi de salmón y atún','2024-06-18','bajo',15,'arroz','Keith Richards','<p>Deja descongelar el atún y el salmón en la nevera en un recipiente con rejilla.</p><p>Limpia el arroz 3 veces y escúrrelo hasta que el agua salga limpia. Ponlo en una cazuela y añádele el doble de su volumen de agua. Hiérvelo a fuego fuerte durante 1 minuto y después continúa la cocción a fuego muy bajo y tapado durante 10 minutos.</p><p>Pasado este tiempo, sácalo del fuego y déjalo reposar 10 minutos más aún tapado. Finalmente, añade el vinagre, la sal, el azúcar y un poco de wasabi, y deja que se enfríe antes de utilizarlo.</p><p>Para hacer el makisushi: corta el salmón y el atún a tiras largas; corta también el aguacate y el pepino a tiras finas y largas.</p><p>Pon una lámina de nori encima de la alfombrita de sushi, esparce por encima un poco de arroz y añádele el salmón o el atún y el aguacate o el pepino, haciendo la combinación que más te guste. Con la ayuda de la alfombrita, envuelve el nori como si se tratara de un canelón y déjalo en la nevera un rato. Después, córtalo en 6 partes.</p><p>Sirve el plato y acompáñalo con salsa de soja, wasabi y el jengibre en conserva.</p>','img/picture1.jpeg'),(2,'Fideuá de calamares en romesco','2024-06-19','medio',60,'fideos','Mick Jagger','<p>Calienta tu horno a 200-220ºC. Mientras tanto calienta una paellera o sartén apta para horno a fuego fuerte. Saltea el CALAMAR PATAGÓNICO LIMPIO TROCEADO con un chorrito de aceite de oliva y dóralos 1 minuto. Reserva.</p><p>En la misma sartén, a fuego fuerte, añade el PISTO DE VERDURAS directamente congelado con un chorrito de aceite de oliva (sal no). Saltea a fuego fuerte 2-3 minutos y añade el sofrito. Baja el fuego y deja reducir hasta evaporar toda el agua.</p><p>Aún a fuego bajo, añade los fideos y dóralos. Añade un par de cucharadas más de aceite de oliva (2 minutos). Mientras tanto, mezcla el sobre de FUMET CONCENTRADO DE PESCADO DE ROCA con 1 vaso de agua (250 ml.) y llévalo a ebullición.</p><p>Añade de nuevo el CALAMAR PATAGÓNICO TROCEADO a la paellera y sube el fuego de nuevo. Moja con el FUMET DE PESCADO, reparte bien y lleva al horno (6-8 minutos) hasta que se haya consumido todo el caldo. Retira, deja reposar 1 minuto y sirve con una cucharada de salsa romesco.</p>','img/picture2.jpeg'),(3,'Molestiae inventore repudiandae quaerat incidunt non saepe','2024-02-05','bajo',48,'modi','Justyn Considine DVM','Ut consequatur autem in. Nisi quod beatae dolorem est quas fuga velit. Praesentium nobis repellat commodi et nihil debitis est atque. Provident et non quia velit dolores earum odit aliquam.<br>Consectetur dolores expedita dolores aliquam quo. Omnis qui esse in. Quis est beatae libero perspiciatis est. Sit est explicabo veniam perspiciatis porro ex in sunt.<br>Ipsam nobis minus nihil commodi quis incidunt omnis aut. Sint sed illum nemo sapiente velit tempore. Inventore aut amet tempora nulla.<br>Eius voluptas rerum et velit omnis delectus molestiae cupiditate. Fugit dolor illum asperiores nesciunt. Cum voluptatibus ut dicta maiores.<br>Velit modi sunt doloribus neque omnis quis. Quam qui ducimus provident accusantium non voluptatem. Et voluptas nam eaque veniam tempore iste dolorem. A ea in est. Omnis repellendus omnis et ipsa et illo dicta sed.','https://via.placeholder.com/640x480.png/00ffdd?text=receta+et'),(4,'Nulla doloremque beatae adipisci omnis facilis tempora quidem','2024-02-13','alto',66,'quasi','Victoria Torphy','Cupiditate enim voluptas aut facilis culpa necessitatibus est. Eaque quia rerum porro aut dicta. Ad distinctio et ut non distinctio.<br>Sit omnis sapiente facilis ut. Sit qui ducimus quo occaecati.<br>Qui architecto iste rem optio. Rerum sunt accusantium sapiente sit quas animi doloremque. Enim dolorem autem nostrum magni recusandae eveniet.<br>Non corrupti laborum perferendis vel qui. Magnam id occaecati enim ab consequatur ipsam.','https://via.placeholder.com/640x480.png/00ff55?text=receta+qui'),(5,